import React from 'react';
import Navbar from './Components/Inicio/Navbar';
import Home from './Components/Inicio/Home';
import LoginRegister from './Components/LoginRegister/LoginRegister';
import './App.css';

function App() {
    return (
        <div className="App">
            <Navbar />
            <Home />
            <LoginRegister />
        </div>
    );
}

export default App;
